import React , {useState, useEffect} from 'react';
import { TextField } from '@material-ui/core';
import { Button } from '@material-ui/core';
import axios from 'axios';




const Title1 = {
  fontSize: '20px',
  color: '#008037',
  fontWeight: 'bold',
  marginLeft: '20px',
  justifyContent: 'center'
}
const Field = {
  marginLeft: '20px',
  width: '500px',
  marginTop: '25px',
  padding: '15px',


}
const buttonstyle = {
  marginLeft: '150px',
  marginTop: '50px',
  backgroundColor: '#008037',
  width: '80px',
  borderRadius: '5px'



}

const Basketsadd = () => {

const [data, setData] = React.useState({
  error: '',
  data: [],
  temp: [],
  error: null,
  items: []

});

const addBasket =  () => {
  let items =  localStorage.getItem('itemInvendu');

  console.log(items)
  axios.post('https://api.foodealzapi.com/Invendus/4', items).then((res) => {
    res.header ('Access-Control-Allow-Origin','*'),
          
        res.header("Access-Control-Allow-Headers", "Origin, X-Requested-With, Content-Type, Accept");

    console.log(res.data)
  })
    .catch(error => {
        console.log(error)
    });
//   items.map((item) => {

//   })
//   sessioncStorage.setItem('items', JSON.stringify([]));

  setData({
    ...data,

  })
  // navigation.jumpTo('Mes Couffins')
  // navigation.goBack()
}





  return (
    <div >
      <div style={Title1}>
        <h2> Enter new Basket</h2>
      </div>
      <div style={Field}>
        <TextField
          label="Enter name" />

        <TextField style={{ marginLeft: '50px' }}
          label="Enter PriceBeforeDis" />

      </div >

      <div style={Field}>
        <TextField
          label="Enter PriceAfterDiscount" />
      </div>
      <div style={Field}>
        <TextField
          label="Enter Discount" />

        <TextField style={{ marginLeft: '50px' }}
          label="Enter Description" />

        <TextField style={{ marginLeft: '50px' }}
          label="Enter restaurant_id" />
      </div>



      <div style={buttonstyle}>
        <Button variant="outline-success" onClick={ () => this.addBasket()} >Valider</Button>
      </div>

    </div>

  )

};

export default Basketsadd;
